import React, { useState } from 'react';


const Component4 = (props) => {

    return (
      <div>
        {props?.users?.map(item => (
          <div key={item.id}>
            <p>{item.id}</p>
            <p>{item.email}</p>
                                <p>{item.userName}</p>
                                <p>{item.fullName}</p>
                                <p>{item.department}</p>
                                <p>{item.position}</p>                  
          </div>  
        ))}
      </div>
    )
  }

  export default Component4;
